import React, { Image } from "react";
import logo from "./logo.svg";
import { ExplorerForm } from "./components/ExplorerForm";
import ExplorerGraph from "./components/ExplorerGraph";
import greenblack from "./resources/green-black.png";

function App() {
  return (
    <div className="App" style={{ backgroundColor: "black" }}>
      <header className="App-header">
        <div style={{ display: "flex", flex: "column" }}>
          <div style={{ height: "10%" }}>
            <Image src={greenblack} />
          </div>
          <div
            style={{
              display: "flex",
              flex: "row",
              height: "90%",
              width: "100%",
            }}
          >
            <div style={{ width: "50%" }}>
              <ExplorerGraph />
            </div>
            <div style={{ width: "50%" }}>
              <ExplorerForm />
            </div>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
